// Home.js
import React from 'react';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div>
      <h1>Home Page</h1>
      <p>You are currently on the Home page.</p>
      <nav>
        <Link to="/about">Go to About Page</Link>
      </nav>
    </div>
  );
}

export default Home;
